import React, { useState } from "react";
import {Button} from "react-bootstrap";
import './schedule.scss';
import LeadsOverview from './leadsOverview';

function Schedule (){
    const DATA = [
        {
          id: 'af1',
          label: 'All Activities',
          items: [
            {id: 'af2', label: 'Cultural Exploration ',time:7},
            {id: 'af3', label: 'Local market visit',time:8},
            {id: 'af4', label: 'Mandovi River  cruise ',time:3},
            {id: 'af5', label: 'Water sports at Grand island',time:4},
            {id: 'af6', label: 'Clubbing at Titos lane',time:5},
            {id: 'af7', label: 'A day at Baga Beach',time:9},
          ],
          tint: 1,
        },
        {
          id: 'af4',
          label: 'Closing leads',
          items: [
            {id: 'af5', label: 'Item 1'}, 
            {id: 'af6', label: 'Item 2'}, 
          ],
          tint: 2,
        },
        {
          id: 'af7', label: 'On hold', 
          items: [
            {id: 'af8', label: 'Item 1'}, 
            {id: 'af9', label: 'Item 2'}, 
          ],
          tint: 3,
        }, 
      ];
return(
    <div className='layout__wrapper'>
      <div className='layout__header'>
        <div className='app-bar'>
          <div className='app-bar__title'>
            Sales Overview
          </div>
        </div>
      </div>
      <LeadsOverview DATA={DATA}/>
    </div>
)
}
export default Schedule;
